$(document).ready(function() {
    $('<div class=cpuspam></div>').appendTo('body');
    b = $('.cpuspam');
    $('<div class=productivity></div>').appendTo(b);
    bp = $('.productivity');
    $("<style>.cpuspam{position:absolute;top:0;left:0;width:100%;height:100%;z-index:-1}.productivity{position:absolute;top:-20px;left:-20px;z-index:-1}.productivity span{position:absolute;display:block;padding:0;margin:0;width:250px;height:250px;background-repeat:no-repeat;background-position:center center;z-index:-1}</style>").appendTo(b);

    h = $(document).height(), w = $(document).width();
    h = Math.ceil(h/250)*2;
    w = Math.ceil(w/250)*2;
    l = 0, t = 0;
    for(j=0; j<h; j++) {
        for(i=0; i<w; i++) {
            $("<span style='top: "+t+"px; left: "+l+"px'></span>").appendTo(bp);
            l+=250;
        }
        t+=250;
        l=0;
    }



    if(window.location.search == '?nobg') return b.css('background', 'none');
    p = 0;
    setInterval(function() {
        p-=10;
        if(p<=-250) p=0;
        b.css('top', p+'px');
        b.css('left', p+'px');
    }, 100);
    frames = [
        'data:image/gif;base64,','data:image/gif;base64,', 'data:image/gif;base64,', 'data:image/gif;base64,', 'data:image/gif;base64,'
    ];
    // makes everything one off
    frames[frames.length]=frames[0];
    f = [], i = 0;

    $e = $('.productivity span');

    $e.each(function() {
        if(i > frames.length) i = 0;
        f.push(++i);
    });
    setInterval(function() {
        i = 0;
        $e.each(function() {
            i++;
            if(typeof f[i] == 'undefined' || f[i] >= frames.length) f[i] = 0;
            cf = f[i];
            $(this).css('background', 'url('+frames[cf]+')');
            f[i]++;
        });
    }, 100);
});